import Nav from 'react-bootstrap/Nav';
import { Link } from "react-scroll";

const NavBar = () => {
    return (

<Navbar bg="dark" expand="md" fixed='top'>
  <Navbar.Brand href="#home">EdMiles.tech</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
        <span className='nav-links'>
        <Link
            activeClass="active"
            to="homeH1"
            spy={true}
            smooth={true}
            offset={-100}
            duration={1000}
        >Home
        </Link>
        </span>
        <span className='nav-links'>
        <Link
            activeClass="active"
            to="projectTabs"
            spy={true}
            smooth={true}
            offset={-100}
            duration={1000}
        >Projects
        </Link>
        </span>
    </Nav>
  </Navbar.Collapse>
</Navbar>


